import React from 'react';
import './about_us.css';

// Importación de componentes
import History from './history/history';
import Testimony from './testimony/testimony';
import Team from './team/team';

const AboutUs = () => {
  return (
    <div className="about-us-container">
      <div className="about-us-banner">
        <h1>Conócenos</h1>
        <p>Descubre más sobre nuestra institución.</p>
      </div>

      {/* Sección de Historia */}
      <div className="section white-section">
        <div className="white-section-content">
          <h2>Nuestra Historia</h2>
          <History /> {/* Componente History */}
        </div>
      </div>

      {/* Sección de Equipo */}
      <div className="section white-section">
        <div className="white-section-content">
          <h2>Nuestro Equipo</h2>
          <Team /> {/* Componente Team */}
        </div>
      </div>

      {/* Sección de Testimonios */}
      <div className="section white-section">
        <div className="white-section-content">
          <h2>Testimonios</h2>
          <Testimony /> {/* Componente Testimony */}
        </div>
      </div>

      {/* Secciones adicionales para Misión, Visión, etc. */}
      {/* ... */}

    </div>
  );
}

export default AboutUs;
